def writef(file, val):
    #	print "%s <- %s" % (file, val)
    with open(file, 'w') as f: f.write(val)


def readf(file):
    #	print "%s <- %s" % (file, val)
    with open(file, 'r') as f: ret = f.read()
    return ret

class GPIO:
    def __init__(self, num, dir='out'):
        self.num = num
        self.val = 0
        if (not os.path.exists("/sys/class/gpio/gpio"+str(num))):
            writef("/sys/class/gpio/export", "%s" % num)
            writef("/sys/class/gpio/gpio%s/direction" % num, dir)
            #print("GPIO"+str(num)+" Tanımlandı.")

    def close(self):
        writef("/sys/class/gpio/gpio%s/direction" % self.num, "in")
        writef("/sys/class/gpio/unexport", "%s" % self.num)

    def get(self):
        return int(readf("/sys/class/gpio/gpio%s/value" % self.num))

    def set(self, val=1):
        if val == 0:
       	    self.val = 0
        else:
	        self.val = 1
        writef("/sys/class/gpio/gpio%s/value" % self.num, "%s" % self.val)
        # print("GPIO" + str(self.num)+": "+str(self.val))
        return self.val

    def clear(self):
        self.set(0)

    def pulse(self):
        if (self.val):
	        self.set(0)
	        time.sleep(1)
	        self.set(1)
        else:
            self.set(1)
            time.sleep(1)
            self.set(0)

class ILI9341:
    def __init__(self, mode_RGB = "RGB"):
        self.rotate = 90
        self.nCS    = GPIO(LCD_nCS)
        self.RD     = GPIO(LCD_RD)
        self.WR     = GPIO(LCD_WR)
        self.DC     = GPIO(LCD_RS) #nCMD_DATA
        self.nRST   = GPIO(LCD_nRST)
        self.DB     = []

        for i in LCD_DB:
            self.DB.append(GPIO(i))

        self.nRST.clear()
        self.nRST.set() #Reset disable
        self.nCS.set()
        self.WR.set()
        self.RD.set()

        ''' LCD Initialization '''
        # Software RST
        self.lcd_write_cmd(0x01)
        time.sleep(0.1)
        
        # Display OFF
        self.lcd_write_cmd(0x28)
        
        self.lcd_write_cmd(0xEF)
        self.lcd_write_data(0x03)
        self.lcd_write_data(0x80)
