        self.lcd_write_cmd(0xEA)
        self.lcd_write_data(0x00)
        self.lcd_write_data(0x00)
        
        # Power Control 1
        self.lcd_write_cmd(0xC0)
        self.lcd_write_data(0x23)
        
        # Power Control 2
        self.lcd_write_cmd(0xC1)
        self.lcd_write_data(0x10)
        
        # VCOM Control 1
        self.lcd_write_cmd(0xC5)
        self.lcd_write_data(0x3E)
        self.lcd_write_data(0x28)
        
        # VCOM Control 2
        self.lcd_write_cmd(0xC7)
        self.lcd_write_data(0x86)
        
        # COLMOD: Pixel Format Set
        # 16 bits/pixel
        self.lcd_write_cmd(0x3A)
        self.lcd_write_data(0x55)

        # Frame Rate Control
        # Division ratio = fosc, Frame Rate = 79Hz        
        self.lcd_write_cmd(0xB1)
        self.lcd_write_data(0x00)
        self.lcd_write_data(0x18)

        # Display Function Control
        self.lcd_write_cmd(0xB6)
        self.lcd_write_data(0x08)
        self.lcd_write_data(0x82)
        self.lcd_write_data(0x27)

        #MADCL, required to resolve mirroring effect
        self.lcd_write_cmd(0x36)
        if(mode_RGB == "RGB"):
            self.lcd_write_data(0x48)
            self.set_display_options()
            print("Color LCD in RGB mode")
        else:
            self.lcd_write_data(0x40)
            self.set_display_options()
            print("Color LCD in BGR mode")

        # Gamma Function Disable
        self.lcd_write_cmd(0xF2)
        self.lcd_write_data(0x00)

        # Gamma Curve Selected
        self.lcd_write_cmd(0x26)
        self.lcd_write_data(0x01)

