        self.lcd_write_data(0x09)
        self.lcd_write_data(0x00)

        # Negative Gamma Correction
        self.lcd_write_cmd(0xE1)
        self.lcd_write_data(0x00)
        self.lcd_write_data(0x0E)
        self.lcd_write_data(0x14)
